webpackJsonp([0x9767b38d23a1],{346:function(e,t){e.exports={data:{markdownRemark:{html:'<p>This will be quick! Well, I guess that depends on your connection.</p>\n<p>While its currently only an experimental feature, there is actually a handy way to check your internet connection speed directly in the browser. No, you don\'t need to navigate to a \'speed-test\' site.</p>\n<p>At the moment, both Chrome and Edge browsers have enabled this capability by default but, for now, Firefox only works if you manually enable (as of FF 90).</p>\n<p>So if you are on Chrome or Edge, open the console and type the following:\n<code>navigator.connection.downlink</code></p>\n<p>For example, in my current location, I was able to see that my internet downlink speed currently sits at 1.6Mbps:</p>\n<div style="text-align:center">\n  <img src="static/images/downlink.png" alt="downlink" width="500px">\n</div>',frontmatter:{date:"May 17, 2021",path:"/internet-speed",title:"This is your internet speed"}}},pathContext:{}}}});
